import React, { Component } from "react";
import Header from "./header/header";
import Grid from "./grid/grid";

class MainWrapper extends Component {
  state = {
    nodes: [],
  };

  render() {
    return;
    <div>
      <Header />
      <Grid />
    </div>;
  }
}

export default MainWrapper;
